import React from 'react';

function StarRate(props) {
let star = "";
for(let i=0;i<5;i++){
  if(i<props.rate){
    star = star + "<div />";
  } else {
    star = star + "<p />";
  }
}

return (
  <div className="StarRate">
    {star}
  </div>
);

}

export default StarRate;
